import React from 'react'
import "./TrustUs.css";


function TrustUs() {
  return (
    <div className='trust-us-container'>
        <div className='gmp-container'><img src="./img/gmp.png"></img></div>
        <div className='trust-us-p-container'></div>
        <div className='iso-container'><img src="./img/iso.png"></img></div>

    </div>
  )
}

export default TrustUs
